import React from 'react';

function List({ people }) {
  console.log(Array.isArray(items.results), items.results, isLoaded);

  return (
    <>
      {people.map((person) => {
        const { id, name, dob, picture } = person;
        return (
          <article key={id.value} className="person">
            <img src={picture.medium} alt={name.first} />
            <div>
              <h4>
                {name.first} {name.last}
              </h4>
              <p>{dob.age} years</p>
            </div>
            <div>
              <button id="delete">X</button>
            </div>
          </article>
        );
      })}
    </>
  );
}

export default List;
